import logoDark from './img/logo-dark.png'

function Footer()
{
    return (
        <div style={{ backgroundColor:"transparent" }}>
            <div style={{ margin:0 }}>
                <img src={logoDark} alt="logo" style={{ height:"85px" }}/>
                <p>pTRAINZILLA was developed by MMU diploma students, as a final year project.</p>
            </div>
        </div>
    )
}

export default Footer
